import React from 'react'

const Header = () => {
  return (
    <>
        <header className='d-flex justify-content-between bg-dark text-white header'>
            <h2>React Practice</h2>
            <button className='btn btn-success'>Add</button>
        </header>
    </>
  )
}

export default Header
